Defendant Clifford Charles Debassige in court with attorney Louis Edward Epps.  Defendant Clifford Charles Debassige in custody.  James Frisch appeared for the State of Wisconsin.  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty as charged in the Information and ordered a Judgment of Conviction be entered into the record.  Court further advised defendant of voting ineligibility.   Sentencing proceeded.  Statements by the State, defense and defendant.  The Court imposed the following sentence:  

AS TO COUNT #1:   The Defendant's TOTAL LENGTH OF SENTENCE shall be three (3) years consecutive to any other sentence.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for eighteen (18) months with credit for zero (0) days time served.  Defendant shall serve eighteen (18) months on EXTENDED SUPERVISION.   The Defendant IS eligible for the Challenge Incarceration Program and the Wisconsin Substance Abuse Program.  The Court advised the defendant of his determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to Defendant.

The Court STAYED THE SENTENCE and placed the defendant on probation to the State Department of Corrections for a period of three (3) years.
*Court ordered defendant to provide a DNA Sample.

AS TO COUNT #2:  The Court orders six (6) months incarceration at the House of Correction, concurrent to Count #1, imposed and stayed, and placed defendant on one (1) year probation, concurrent to Count #1.  Pay the DNA surcharges, costs and disbursements while on probation. 

CONDITIONS OF PROBATION AS TO COUNT #1 AND COUNT #2 (and Extended Supervision, if revoked on Count 1):
 - The Court imposed 60 days condition time.  The Defendant can be released on Huber for work and treatment and release to the Day Reporting Center; good time allowed.
 - No Contact with Johanna R. Badger Liquor or Wal-Mart (In South Milwaukee)
 - No controlled substances or alcohol;
 - AODA assessment; treatment, if needed;
 - Urine screens to ensure compliance;
 - Seek and maintain employment;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Undergo a mental health evaluation; follow thru with any treatment recommended;
 - No controlled substances other than those legally prescribed by a duly licensed physician for his mental or physical needs; take as prescribed and onbly for as long as deemed medically reasonable and necessary.
 - Pay the DNA surcharge, costs and disbursements by the end of probationary period.  Should defendant get revoked and be sent to prison, Court ordered monies taken by the Department of Correction from up to 25% of prison funds.  Balance would be then be paid while on Extended Supervision.  Pay restitution to Badger Liquor stipulated amount of $2613.54 and to John L. of $515.52.  CASH BAIL ON DEPOSIT TO APPLY.  Court ordered the defendant to pay the DNA surcharge, costs and disbursements; CASH BAIL ON DEPOSIT TO APPLY.
